; ---------------------------------------------------------------

.segment	"CODE"

.proc	_CheckIfGoalTile: near

.segment	"CODE"

;
; {
;
	jsr     pusha
;
; return tile == 0x04 || tile == 0x05 || tile == 0x14 || tile == 0x15;
;
	ldy     #$00
	lda     (sp),y
	cmp     #$04
	beq     L0004
	cmp     #$05
	beq     L0004
	cmp     #$14
	beq     L0004
	cmp     #$15
	beq     L0004
	ldx     #$00
	txa
	jmp     incsp1
L0004:	lda     #$01
	ldx     #$00
;
; }
;
	jmp     incsp1

.endproc

; ---------------------------------------------------------------
; void __near__ UpdateColliderPositions (void)
; ---------------------------------------------------------------

.segment	"CODE"

.proc	_UpdateColliderPositions: near

.segment	"CODE"

;
; playerLeft = playerX - 8;
;
	lda     _playerX
	ldx     _playerX+1
	sec
	sbc     #$08
	bcs     L0002
	dex
L0002:	sta     _playerLeft
	stx     _playerLeft+1
;
; playerRight = playerX + 8;
;
	lda     _playerX
	ldx     _playerX+1
	clc
	adc     #$08
	bcc     L0003
	inx
L0003:	sta     _playerRight
	stx     _playerRight+1
;
; playerTop = playerY - 8;
;
	lda     _playerY
	ldx     _playerY+1
	sec
	sbc     #$08
	bcs     L0004
	dex
L0004:	sta     _playerTop
	stx     _playerTop+1
;
; playerBottom = playerY + 8;
;
	lda     _playerY
	ldx     _playerY+1
	clc
	adc     #$08
	bcc     L0005
	inx
L0005:	sta     _playerBottom
	stx     _playerBottom+1
;
; }
;
	rts

.endproc

; ---------------------------------------------------------------
; void __near__ DashEnd (void)
; ---------------------------------------------------------------

.segment	"CODE"

.proc	_DashEnd: near

.segment	"CODE"

;
; if (isDashing)
;
	lda     _isDashing
	ora     _isDashing+1
	beq     L0002
;
; isDashing = 0;
;
	lda     #$00
	sta     _isDashing
	sta     _isDashing+1
;
; dashCooldown = DASH_COOLDOWN;
;
	lda     #$14
	sta     _dashCooldown
;
; }
;
L0002:	rts

.endproc

