L000C:	jsr     _DrawTitleScreen
;
; ppu_wait_nmi();
;
L0002:	jsr     _ppu_wait_nmi
;
; movementPad = pad_poll(0);
;
	lda     #$00
	jsr     _pad_poll
	sta     _movementPad
;
; inputPad = get_pad_new(0);
;
	lda     #$00
	jsr     _get_pad_new
	sta     _inputPad
;
