	lda     _currentGameState
;
; }
;
	beq     L000D
	cmp     #$01
	beq     L0009
	cmp     #$02
	beq     L000E
	jmp     L0002
;
; if (inputPad & PAD_START)
;
L000D:	lda     _inputPad
