; currentGameState = GAME_LOOP;
;
	lda     #$01
	sta     _currentGameState
;
; GameLoop();
;
	jsr     _GameLoop
;
; break;
;
	jmp     L0002
;
; UpdateColliderPositions();
;
L0009:	jsr     _UpdateColliderPositions
;
; MovePlayer();
;
	jsr     _MovePlayer
;
; DrawPlayer();
;
	jsr     _DrawPlayer
;
; scroll(scrollX, 0);
