; if (inputPad & PAD_START)
;
L000E:	lda     _inputPad
	and     #$10
	beq     L0002
;
; currentGameState = START_SCREEN;
;
	lda     #$00
	sta     _currentGameState
;
; break;
;
	jmp     L000C

.endproc

